import { Route, Routes } from "react-router";

const Welcome = () => {
    return (
        <section>
            <h1>The welcome page</h1>
            {/* nested route */}
            <Routes>
                <Route path="/welcome/new-user" element={<p>Welcome.new user!</p>} />
            </Routes>
        </section>
    )
};

export default Welcome;
